import React from "react";
import styled from "styled-components";
import AbcIcon from "@mui/icons-material/Abc";

//styling our component

const Wrapper = styled.div`
  background-color: #f1f2f6;
  height: 64px;
`;

export default function Header() {
  return (
    <Wrapper>
      <h1>Header</h1>
    </Wrapper>
  );
}
